import { Component, Prop, Vue } from 'vue-property-decorator';

@Component({})
export default class Hiddeninput extends Vue{
  inheritAttrs!: false;
  @Prop() value!: [string, number];

  public updateValue(event: any) {
    this.$emit('input', event.target.value)
  }
}
